– Савченко Надежда, народный депутат Украины VIII созыва, глава ПП "Общественно-политическая платформа Надежды Савченко";
– Кузьмин Ренат, народный депутат Украины, фракция "Оппозиционная платформа - За жизнь";
– Чернышев Роман, представитель партии “Национальный корпус”;
– Камельчук Юрий, народный депутат Украины, фракция "Слуга народа";
– Королевская Наталья, народный депутат Украины, фракция "Оппозиционная платформа - За жизнь";
– Карасев Вадим, политический эксперт;
– Крулько Иван, народный депутат Украины, фракция ВО "Батькивщина";
– Коротких Сергей "Боцман", командир разведки полка "Азов" 2014;
– Бондаренко Елена, народный депутат Украины V-VII созывов;
– Шевченко Евгений, народный депутат Украины, фракция "Слуга народа".

